import React, { FC } from "react"
import { postProps } from "../../App"
import avatar from "../../images/png/Bitmap.png"

import styles from "./../../components/Bookmarks/bookmarks.module.css"

type props = {
  postNews: postProps[]
}

export const Bookmarks: FC<props> = ({ postNews }) => {
  const counterLike = 1

  return (
    <section className={styles.wrapper}>
      <section className={styles.news}>
        {postNews.map((el: any, index: any) => (
          <div key={index} className={styles.newsWrapper}>
            <div className={styles.priv}>
              {/* <img src={avatar} alt="avatar" className={styles.newsAvatar} /> */}

              <h2 className={styles.nortwest}>Northwest Agency</h2>
            </div>
            <div className={styles.postWrapper}>
              <p className={styles.digitalItem}>{el.value}</p>
            </div>
            <nav>
              <ul className={styles.postNav}>
                {postNews.map((item: any, index: any) => {
                  if (item === "/static/media/like.c755a9fe.svg") {
                    return (
                      <li key={index} className={styles.liLike}>
                        <button type="button">
                          <img
                            src={item}
                            alt={`${index}`}
                            className={el.isFlagLike ? styles.itemLike : ""}
                          />
                        </button>
                        <span>{el.isFlagLike ? counterLike : ""}</span>
                      </li>
                    )
                  }
                  return (
                    <li key={index} className={styles.liLike}>
                      <button type="button">
                        <img src={item} alt={`${index}`} />
                      </button>
                    </li>
                  )
                })}
              </ul>
            </nav>
          </div>
        ))}
      </section>
    </section>
  )
}
